<script setup>
import GoCaptcha from "./components/GoCaptcha.vue";
import {onMounted, ref} from "vue";

const showCaptcha = ref(false)

const imageBase64 = ref("")
const thumbBase64 = ref("")
const Key = ref("")

const maxDots = ref(10)

let serverExampleObj =  {
    "image_base64": "data:image/jpeg;base64,",
    "thumb_base64": "data:image/png;base64,",
    "captcha_key": "b27b064931ca0ef5a3ed24f392bc8ef3"
}

function cleanCaptchaImgDate() {
    Key.value = ""
    imageBase64.value = ""
    thumbBase64.value = ""
}

function handleOpenEvent() {
    showCaptcha.value = true
    handleRefreshEvent()
}

function getImageSize(url) {
    return new Promise(function (resolve, reject) {
        let image = new Image();
        image.onload = function () {
            resolve({
                width: image.width,
                height: image.height
            });
        };
        image.onerror = function () {
            reject(new Error('failed to load image'));
        };
        image.src = url;
    });
}

function handleRefreshEvent() {
    cleanCaptchaImgDate()

    // you should get same data from your server
    setTimeout(async () => {

            Key.value = serverExampleObj.captcha_key
            imageBase64.value = serverExampleObj.image_base64
            thumbBase64.value = serverExampleObj.thumb_base64
        }
        , 1000)
}

function handleConfirmEvent(data, ok, fail) {
    let arr = []
    for (let i = 0; i < data.length; i++) {
        let dot = {
            "x": 0,
            "y": 0,
        }
        dot.x = data[i].x
        dot.y = data[i].y
        arr.push(dot)
    }
    console.log(arr)

    setTimeout(() => {
        ok("验证通过！")
        // you can call fail() also
        //fail("验证失败)
    }, 700)


}

function handleCloseEvent() {
    showCaptcha.value = false
    cleanCaptchaImgDate()
}

onMounted(() => {
    handleOpenEvent()
})

</script>

<template>
    <div v-if="showCaptcha" class="captcha-wrap fade">
        <div class="captcha-box-wrap">
            <go-captcha
                    :max-dot="maxDots"
                    :image-base64="imageBase64"
                    :thumb-base64="thumbBase64"
                    @close="handleCloseEvent"
                    @confirm="handleConfirmEvent"
                    @refresh="handleRefreshEvent"
            />
        </div>
    </div>
</template>

